define('text!templates/resource.html',[],function () { return '<div class="resource-tile-container">\n    <div class="resource-tile">\n        <div class="resource-tile-image-container">\n            <img class="resource-tile-image" src="<%= provider.escape(\'image\') %>">\n        </div>\n        <div class="resource-tile-title"><%= provider.escape(\'name\') %></div>\n        <% if (provider.get(\'tags\').length > 0) { %>\n            <div class="resource-tile-tags"><%= provider.formatTags() %></div>\n        <% } %>\n        <div class="resource-tile-description"><%= provider.escape(\'description\') %></div>\n        <div class="resource-tile-actions">\n            <% if (currentUser.authorized()) { %>\n                <a href="#" class="resource-tile-vote<% if (provider.get(\'voted\')) { %> active<% } %> vote-resource">\n                    <span class="resource-tile-vote-label">\n                        <span class="normal">I am using it</span>\n                        <span class="voted">I love it</span>\n                    </span>\n                    <span class="resource-tile-vote-counter"><%= provider.escape(\'votes_count\') %></span>\n                </a>\n            <% } %>\n        </div>\n    </div>\n</div>\n';});

define('views/resource',[
    'backbone',
    'jquery',
    'text!templates/resource.html',
    'models/current_user'
], function(
    Backbone,
    $,
    template,
    currentUser
) {

    var View = Backbone.View.extend({
        board: null,
        template: _.template(template),
        events: {
            'click .vote-resource': 'onVoteResourceClicked'
        },
        initialize: function(provider) {
            this.provider = provider;
            this.provider.on('change:voted, change:votes_count', function() { this.onProviderVotesChanged() }, this);
        },
        render: function() {
            this.$el.html(this.template({
                provider: this.provider,
                currentUser: currentUser
            }));
            return this;
        },
        onVoteResourceClicked: function(e) {
            e.preventDefault();

            this.provider.toggleVote();
        },
        onProviderVotesChanged: function() {
            this.$el.find('.resource-tile-vote').toggleClass('active', this.provider.get('voted'));
            this.$el.find('.resource-tile-vote-counter').text(this.provider.escape('votes_count'));
        }
    });

    return View;
});

