define('views/resources',[
    'backbone',
    'jquery',
    'text!templates/resources.html',
    'views/resource',
    'collections/all_providers',
    'collections/languages',
    'collections/provider_tags',
    'viewManager',
    'masonry-layout',
    'select2'
], function(
    Backbone,
    $,
    template,
    ResourceView,
    AllProvidersCollection,
    LanguagesCollection,
    ProviderTagsCollection,
    viewManager
) {

    var View = Backbone.View.extend({
        $scrollable: function() { return this.$el.find('.content-scrollable') },
        $container: function() { return this.$el.find('.resource-tiles') },
        loadMoreOnSpaceLeft: 400,
        loading: false,
        template: _.template(template),
        events: {
            'click .create-resource': 'onCreateResourceClicked',
            'change select': 'onFiltersUpdated',
            'click .mobile-header-menu-button': 'onMenuButtonClicked'
        },
        initialize: function() {
            this.providers = new AllProvidersCollection();
            this.languages = new LanguagesCollection();
            this.provider_tags = new ProviderTagsCollection();
            this.providers.on('add', this.onItemAdd, this);
            this.on('show', this.onShow);

            var view = this;

            this.languages.fetch({
                success: function() {
                    view.render();
                }
            });
            this.provider_tags.fetch({
                success: function() {
                    view.render();
                }
            });
        },
        remove: function() {
            this.providers.off('add', this.onItemAdd, this);
            this.$scrollable().off('scroll', this.fetchItemsIfNeededCallback);
        },
        render: function() {
            this.$el.html(this.template({
                languages: this.languages,
                provider_tags: this.provider_tags
            }));

            this.$el.find('select').each(function() {
                var $select = $(this);
                var options = {
                    theme: 'flatun',
                    minimumResultsForSearch: -1
                };

                if ($select.data('placeholder')) {
                    options = $.extend(options, {
                        placeholder: $select.data('placeholder')
                    })
                }

                $select.select2(options);
            });


            var view = this;
            this.fetchItemsIfNeededCallback = function() {
                view.fetchItemsIfNeeded();
            };
            this.$scrollable().on('scroll', this.fetchItemsIfNeededCallback);

            return this;
        },
        onItemAdd: function(model, collection, options) {
            var $item = new ResourceView(model).render().$el;
            this.$container().append($item).masonry('appended', $item);
        },
        onShow: function() {
            this.initLayout();
            this.reloadItems();
        },

        finishLoading: function() {
            this.$container().masonry('layout');
            this.loading = false;
            this.fetchItemsIfNeeded();
        },
        reloadItems: function() {
            this.$container().empty();
            this.$container().masonry('layout');

            this.fetchItems();
        },
        fetchItems: function() {
            if (this.loading) {
                return;
            }

            var view = this;

            this.loading = true;
            this.providers.fetch({
                success: function() { view.finishLoading(); },
                data: this.getCurrentFilters(),
                remove: false
            });
        },
        fetchItemsIfNeeded: function () {
            if (this.$el.parents('html').length == 0) {
                return;
            }

            var spaceLeft = this.$scrollable().get(0).scrollHeight - (this.$scrollable().scrollTop() + this.$scrollable().height());

            if (spaceLeft < this.loadMoreOnSpaceLeft && this.providers.isFetchable()) {
                this.fetchItems();
            }
        },
        initLayout: function () {
            this.$container().find('.resource-tile-container').css('opacity', '0');
            var view = this;

            this.$container().on('layoutComplete', function (event, items) {
                view.$container().find('.resource-tile-container').animate({opacity: 1}, 500);
                view.$container().off('layoutComplete');
            });

            this.$container().masonry({
                itemSelector: '.resource-tile-container',
                columnWidth: '.resource-tile-container',
                percentPosition: true
            });
        },
        getCurrentFilters: function() {
            var filters = {};
            var language = this.$el.find('select[name="language"] option:selected').val();
            var tags = this.$el.find('select[name="tags"] option:selected').val();

            if (!_.isEmpty(language)) {
                filters['language'] = language;
            }

            if (!_.isEmpty(tags)) {
                filters['tags'] = tags;
            }

            return filters;
        },
        onCreateResourceClicked: function(e) {
            e.preventDefault();

            Backbone.router.openCreateResourcePopup();
        },
        onFiltersUpdated: function() {
            this.$container().empty();
            this.providers.reset();
            this.fetchItems();
        },
        onMenuButtonClicked: function(e) {
            e.preventDefault();

            viewManager.sidebarView.toggleSidebarOpened();
        }
    });

    return View
});

define('text!templates/provider-settings-popup.html',[],function () { return '<div class="popup-background close-popup">\n    <div class="content-scrollable close-popup center-vertical">\n        <a href="#" class="close-popup-button provider-settings-popup-close close-popup" title="Close">\n            <span class="close-popup-button-icon close-popup"></span>\n        </a>\n        <div class="provider-settings-popup">\n            <div class="provider-settings-popup-header">\n                <a href="#" class="provider-settings-popup-header-submit">Save</a>\n                <span class="provider-settings-popup-header-title">Add resources</span>\n            </div>\n            <ul class="provider-settings-popup-providers">\n                <% providers.each(function(provider) { %>\n                    <li class="provider-settings-popup-providers-item<% if (provider.get(\'id\') != 0) { %> sortable<% } %>" data-provider-id="<%= provider.get(\'id\') %>">\n                        <% if (provider.get(\'id\') != 0) { %>\n                            <a href="#" class="provider-settings-popup-providers-item-switch switch<% if (provider.get(\'user_active\')) { %> checked<% } %>">\n                                <span class="switch-track"></span>\n                                <span class="switch-knob"></span>\n                            </a>\n                        <% } %>\n\n                        <span class="provider-settings-popup-providers-item-image-wrapper">\n                            <% if (provider.get(\'id\') == 0) { %>\n                                <span class="provider-settings-popup-providers-item-image all-providers"></span>\n                            <% } else { %>\n                                <img class="provider-settings-popup-providers-item-image" src="<%= provider.escape(\'image\') %>">\n                            <% } %>\n                        </span>\n\n                        <span class="provider-settings-popup-providers-item-label"><%= provider.escape(\'name\') %></span>\n\n                        <% if (provider.get(\'site_url\')) { %>\n                            <a href="<%= provider.escape(\'site_url\') %>" class="provider-settings-popup-providers-item-external" target="_blank"><span class="provider-settings-popup-providers-item-external-icon"></span></a>\n                        <% } %>\n                    </li>\n                <% }); %>\n            </ul>\n        </div>\n    </div>\n</div>';});

define('views/provider_settings_popup',[
    'backbone',
    'jquery',
    'text!templates/provider-settings-popup.html',
    'collections/providers',
    'views/popup',
    'models/helpers',
    'viewManager',
    'jquery-ui'
], function(
    Backbone,
    $,
    template,
    providers,
    Popup,
    helpers,
    viewManager
) {

    var View = Popup.extend({
        template: _.template(template),
        events: {
            'click .provider-settings-popup-providers-item-switch': 'onSwitchClicked',
            'click .provider-settings-popup-header-submit': 'onSubmitClicked'
        },
        render: function() {
            this.$el.html(this.template({
                providers: providers
            }));
            helpers.tooltips(this.$el);

            this.$el.find('.provider-settings-popup-providers').sortable({
				items: '.provider-settings-popup-providers-item.sortable',
				scroll: true,
				cursor: 'move'
			});

            return this;
        },
        onSwitchClicked: function(e) {
            e.preventDefault();

            var $switch = $(e.target).closest('.provider-settings-popup-providers-item-switch');
            var $item = $switch.parents('.provider-settings-popup-providers-item');

            $switch.toggleClass('checked');
            $item.toggleClass('active', $switch.hasClass('checked'));
        },
        onSubmitClicked: function(e) {
            e.preventDefault();

            viewManager.setLoading(true);

            this.$el.find('.provider-settings-popup-providers-item.sortable').each(function(i) {
                var $item = $(this);
                var $switch = $item.find('.provider-settings-popup-providers-item-switch');
                var provider = providers.findWhere({id: parseInt($item.data('provider-id'))});

                if (provider != undefined) {
                    provider.set('user_order', i + 1);
                    provider.set('user_active', $switch.hasClass('checked'));
                }
            });

            providers.save({
                success: function() {
                    viewManager.setLoading(false);
                    Backbone.router.closePopup();
                },
                error: function() {
                    viewManager.setLoading(false);
                    alert('error');
                }
            });
        }
    });

    return View;
});


define('text!templates/add-board-feed-item-popup.html',[],function () { return '<div class="popup-background close-popup">\n    <div class="content-scrollable close-popup center-vertical">\n        <div class="choose-board">\n            <div class="choose-board-close-wrapper">\n                <a href="#" class="close-popup-button choose-board-close close-popup" title="Close">\n                    <span class="close-popup-button-icon close-popup"></span>\n                </a>\n            </div>\n            <div class="close-button-container">\n                <a href="#" class="close-button"></a>\n            </div>\n            <div class="choose-board-title">Add this cart to your flat</div>\n            <div class="choose-board-subtitle">You have <span class="boards-count"></span> flats</div>\n            <div class="choose-board-boards"></div>\n            <div class="choose-board-links">\n                <a href="#" class="choose-board-links-item right save">Save changes</a>\n                <a href="#" class="choose-board-links-item secondary left create">+ Create a new flat</a>\n            </div>\n        </div>\n    </div>\n</div>\n';});


